import React from 'react';

function App(){
    
    return(
        <>
            <div className='mainWrapper'>
            <div className='innerWrapper'>
                <div className='listCard'>
                    <h1>Todo List</h1>
                    <input type="text" placeholder="Add a item" onChange={itemEvent} />
                    <button onClick={listOfItems}>+</button>
                </div>
            </div>
            </div>
        </>
    )
}

export default App;
